import React from 'react';
import Imageicon from './saasicon.png';
import { StyleSheet, css } from 'aphrodite';


const styles = StyleSheet.create({
    imageicons:{
        height:'80px',
        width: '100px',
        justifyContent:'center',
        borderRadius:'10px',
        paddingTop:"60px",
        },
    separator: {
        paddingTop: '10vh',
        borderTop: '0.5vh solid ',
        padding:0,
        left:0,
        marginTop: '1vh',
        opacity: 0.06
    },
    text:{
        paddingTop:'3vh',
        fontFamily: 'Muli',
        fontSize: '1vw',
        fontWeight:'bold',
        textAlignLast:'center',
        lineHeight: '12px',
        letterSpacing: '0.2px',
        color: 'black',
    }
    }
)

const Card = () => { 
    return (
        <div className= 'tc bg-light-green dib br3 pa3 ma2 grow bw2 shadow-5 w5'>
            <img alt='robots' src= {Imageicon} className={css(styles.imageicons)}/>
            <div className={css(styles.separator)}></div>

            <div>
                <p className={css(styles.text)}>Sophos as a service</p>
            </div>
        </div>
    )
}
export default Card;
